import React, {Component} from 'react';
export class MyForm extends Component{
    state = {
        name: "",
    }
    handleChange = (event)=>{
        this.setState({name: event.taget.value})
    }
    render(){
        return(
            <input value={this.state.name}/>
        )
    }
}
